// src/components/ContactPage.jsx
import React from "react";
import ContactForm from "./ContactForm"; // Importa el formulario de contacto
import "../styles/ContactPage.css"; // Importa los estilos específicos si los tienes

const ContactPage = () => {
  return (
    <section id="contact" className="contact">
      <h2>Contáctanos</h2>
      <form className="contact-form">
        <input
          type="text"
          placeholder="Nombre"
          required
        />
        <input
          type="email"
          placeholder="Correo"
          required
        />
        <textarea
          placeholder="Mensaje"
          required
        ></textarea>
        <button type="submit">Enviar</button>
      </form>
    </section>
  );
};

export default ContactPage;
